#copy from scsd
s2c = lambda th1, ph1: array((sin(ph1) * cos(th1), sin(ph1) * sin(th1), cos(ph1)))
c2q = lambda om, vec: hstack([array([cos(om/2)]), (vec * sin(om/2))])
s2q = lambda th, ph, om: array([sin(om/2)*sin(ph)*cos(th), sin(om/2)*sin(ph)*sin(th), sin(om/2)*cos(ph), cos(om/2)])
uq2r = lambda x,y,z,w:((1-2*(y**2 + z**2), 2*(x*y - w*z), 2*(x*z + w*y)),(2*(x*y + w*z), 1-2*(x**2 + z**2), 2*(y*z - w*x)),(2*(x*z - w*y), 2*(y*z + w*x), 1-2*(x**2 + y**2)))
q2uq = lambda x,y,z,w: [x,y,z,w]/norm([x,y,z,w])
q2r  = lambda x,y,z,w: uq2r(*q2uq(x,y,z,w))
costmat_gen = lambda m1,m2: npsum(square(diagonal(subtract.outer(m2,m1),0,1,3)),axis = -1)

def assign_mat_for_symm(model, typo, theta, phi, rotation):
    omega     = (2*pi)/rotation
    refvec    = s2c(theta, phi)
    rot_mat   = q2r(*s2q(theta, phi, omega))
    trans_atoms = model.copy()[:,:3]

    if typo in ['improperrotation','mirror']:
        trans_atoms = trans_atoms-outer(2*dot(trans_atoms, refvec),refvec)
    if typo in ['rotation','improperrotation']:
        trans_atoms = dot(rot_mat,trans_atoms.T).T
    if typo == 'inversion':
        trans_atoms = -model[:,:3]

    costmat  = costmat_gen(model[:,:3],trans_atoms)
    row_ind, col_ind = linear_sum_assignment(costmat)
    return col_ind.argsort().tolist()

def return_assign_mat(model, point_group_name):
    ops, pgt, ops_order = [x.get(point_group_name.capitalize()) for x in [point_group_dict,pgt_dict,ordered_ops_dict]]
    ops_vals = [operations_dict.get(x) for x in ops_order]
    return {z:[assign_mat_for_symm(model,*x) for x in y] for z,y in zip(ops_order,ops_vals)}

def generate_superlist(pairs,strop):
    for i,pair in enumerate(pairs):
        for j,at in enumerate(strop):
            if at == pair[0]:
                strop.insert(j,pair[0])
                strop.insert(j+1,pair[1])
                pairs.pop(i)
                return pairs,strop
    return pairs,strop

def generate_line_thru_points(ats,maxdist = 1.75):
    pairs = [[[i,j] for i,x in enumerate(ats) if ((norm(x-y)<maxdist) and (i>j))] for j,y in enumerate(ats)]
    pairs =  [y for x in pairs for y in x]
    strop = pairs[0]
    for x in range(100):
        pairs,strop = generate_superlist(pairs,strop)
        pairs,strop = generate_superlist([x[::-1] for x in pairs],strop)
    return strop

class scsd_model:
    def __init__(self, name, atom_positions, point_group_name, assign_mat=None, pca=None,  database_path=None, maxdist = 1.75,
                    mondrian_limits = None):
        self.name = name
        self.ats = atom_positions
        self.ats_3 = self.ats[:,:3].astype(float)
        self.ats_3_round_4 = npround(self.ats[:,:3].astype(float),4)
        if len(self.ats[0]) == 4:
            self.ats_round_4 = hstack((self.ats_3_round_4,atleast_2d(self.ats[:,3]).T))
        else:
            self.ats_round_4 = self.ats_3_round_4
        self.ptgr = point_group_name.capitalize()
        self.symm = scsd_symmetry(self.ptgr)
        self.pca = pca
        self.assign_mat = assign_mat
        self.database_path = database_path
        self.maxdist = maxdist
        self.mondrian_limits = mondrian_limits
        self.ptgr_html = symm_typog_html.get(self.ptgr,self.ptgr)

    def gen_assign_mat(self):
        self.assign_mat = return_assign_mat(self.ats_3, self.ptgr)

    def __repr__(self):
        not_Nones = [x for x,y in zip('name,ats,ptgr,pca,assign_mat,database_path,maxdist,mondrian_limits'.split(','),[self.name ,self.ats,
        self.ptgr,self.pca,self.assign_mat,self.database_path, self.maxdist, self.mondrian_limits]) if not isinstance(y,type(None))]
        return "scsd_model: " + self.name + "; attributes: " + ', '.join(not_Nones)

